INSERT INTO `wp_posts` VALUES (68,1,'2021-11-17 02:31:35','2021-11-17 02:31:35','<h2>Hire an award-winning attorney to represent you</h2>\r\nMingo &amp; Yankala is an award-winning personal injury firm representing accident victims throughout Milwaukee and beyond. Our philosophy is to provide personal, individual attention to each client and not simply meet their expectations, but far exceed them.\r\n\r\nWhen you choose our firm to represent you, your phone calls will always be promptly returned. Your questions will always be answered in clear and concise language, not in legal jargon no one can understand. Every case we accept is personally handled by an award-winning personal injury attorney ranked by judges and lawyers among the top attorneys in the state in what they do. Your case will never be passed down to a junior lawyer or paralegal to handle.\r\n<h2>A personalized, honest approach to your claim</h2>\r\nWe do not pay actors or local personalities to endorse our firm. Instead, we proudly display on our website actual, unedited testimonials from our current and prior clients. After all, it is our clients who know best what it is like to be represented by M&amp;Y, not an athlete or actor who is simply paid to say good things about us.\r\n\r\nYour claim will never be settled just to pay the lawyer’s advertising bill. If you are looking to be represented by an attorney selected as one of the top attorneys in Wisconsin AND you want the personal attention your case deserves, our office is ready to hear from you.\r\n\r\nYou will always find everyone at M&amp;Y friendly and easy to talk to and we will be happy to answer any questions you have. Remember, the law firm you hire DOES have an effect on the outcome of your case. When you hire M&amp;Y, you will have an attorney who always takes the time to get to know you and who has the skill and experience to obtain the full compensation you deserve.','About Mingo&nbsp;Yankala','','publish','closed','closed','','about-mingo-yankala','','','2021-12-07 21:44:11','2021-12-07 21:44:11','',0,'http://mingo.local/?page_id=68',0,'page','',0);
