INSERT INTO `wp_posts` VALUES (364,1,'2021-11-23 19:53:41','2021-11-23 19:53:41','<h2>Hire an award-winning attorney to represent you</h2>\nMingo &amp; Yankala is an award-winning personal injury firm representing accident victims throughout Milwaukee and beyond. Our philosophy is to provide personal, individual attention to each client and not simply meet their expectations, but far exceed them.\n\nWhen you choose our firm to represent you, your phone calls will always be promptly returned. Your questions will always be answered in clear and concise language, not in legal jargon no one can understand. Every case we accept is personally handled by an award-winning personal injury attorney ranked by judges and lawyers among the top attorneys in the state in what they do. Your case will never be passed down to a junior lawyer or paralegal to handle.\n\nA personalized, honest approach to your claim','About Mingo Yankala','','inherit','closed','closed','','68-autosave-v1','','','2021-11-23 19:53:41','2021-11-23 19:53:41','',68,'http://mingo.local/?p=364',0,'revision','',0);
