INSERT INTO `wp_posts` VALUES (393,1,'2021-12-07 21:44:48','2021-12-07 21:44:48','Mark J. Mingo is one of the founding members of our law firm and has been consistently recognized as one of the top attorneys in Wisconsin. Mark has handled more than 1000 personal injury cases and has successfully tried many cases before juries in counties throughout Wisconsin.\r\n\r\nThroughout Wisconsin, Mark has time and time again proven his skill and insight in the courtroom. He successfully briefed and argued a landmark case before the United States Supreme Court. Mark has also successfully argued cases before the Seventh Circuit Court of Appeals in Chicago and the US District Court in Wisconsin. He has argued multiple cases before the Wisconsin Supreme Court and successfully won cases before the Wisconsin Court of Appeals, as well.\r\n<h3>Mark has also been named for numerous industry awards, including:</h3>\r\n<ul>\r\n 	<li>Voted Wisconsin Super Lawyer®, 2008 – 2015</li>\r\n 	<li>Top 10 Personal Injury Attorneys</li>\r\n 	<li>Top 100 Trial Lawyers</li>\r\n 	<li>Best Attorneys of America</li>\r\n 	<li>AV® Rated by Martindale-Hubbell®</li>\r\n 	<li>Board Certified in both Civil Trial Practice and Civil Procedure.</li>\r\n 	<li>AVVO Rating of 10/10 “Superb”</li>\r\n 	<li>AVVO Client Choice Award</li>\r\n 	<li>Recognized in M Magazine’s Leading Lawyers List (Top 8 to 12% of lawyers within each area of practice</li>\r\n</ul>\r\nMark is also formerly an insurance defense attorney, so he knows the strategies and tactics insurance providers takes when they defend their bottom lines. Our firm is able to use this knowledge to better assert the claims of our clients and ensure that the gravity of their injury is never marginalized by corporate interests.\r\n\r\nWhile it is an honor to receive these awards, the most valued award comes from what our satisfied clients have to say. We are pleased to invite you to read the actual, unedited reviews from our clients. It is our many satisfied clients that continue to spread the good word about our firm and the dedicated work we set out to do on behalf of the injured, the wronged, and the bereaved.\r\n\r\nAre you interested in inquiring about representation? Contact our offices to request a free case evaluation with Attorney Mingo today.','Attorney Mark&nbsp;Mingo','','inherit','closed','closed','','336-revision-v1','','','2021-12-07 21:44:48','2021-12-07 21:44:48','',336,'http://mingo.local/?p=393',0,'revision','',0);
